  `movie_id` bigint(20) NOT NULL,
  `person_id` bigint(20) NOT NULL,
  `person_role_id` int(11) NOT NULL,
  PRIMARY KEY (`movie_id`,`person_id`),
  KEY `fk_movie_person_movie_idx` (`movie_id`),
  KEY `fk_movie_person_person_idx` (`person_id`),
  KEY `fk_movie_person_role_idx` (`person_role_id`),
  CONSTRAINT `fk_movie_person_movie` FOREIGN KEY (`movie_id`) REFERENCES `movie` (`movie_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_movie_person_person` FOREIGN KEY (`person_id`) REFERENCES `person` (`person_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_movie_person_role` FOREIGN KEY (`person_role_id`) REFERENCES `person_role` (`person_role_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
